import ExpenseForm from './components/ExpenseForm';
import ExpenseList from './components/ExpenseList';
import SummaryChart from './components/SummaryChart';

function App() {
    return (
        <div className="app">
            <h1>Expense Tracker</h1>
            <ExpenseForm />
            <ExpenseList />
            <SummaryChart />
        </div>
    );
}

export default App;
